 const contactInfo = {
  name: "Nadia Akhtar",
  role: "Junior Dev",
  email: "something@something.com",
  phone: "000-000-0000"
};

function VCard() {
  return (
    <div className="vCard">
      <h3>{contactInfo.name}</h3>
      <p>{contactInfo.role}</p>
      <p>{contactInfo.email}</p>
      <p>{contactInfo.phone}</p>
    </div>
  );
}
